import React from 'react';
import Box from '@mui/material/Box';
import { Grid, Button, TextField } from '@mui/material';
import { Link } from 'react-router-dom';

export default function ExploreS() {

    return (
        //BasicNavBar 위치 조정
        <Box textAlign='center' style={{ margin : 16, padding: 16, position:'relative'}}>
            <TextField fullWidth  variant="standard" label="email ,ID 또는 할 일 검색" sx={{ boxShadow: 'none'}} /> 
            <Grid container spacing={2}>
                <Grid xs={4} md={4} item >
                    {/* Search component */}
                    <Button 
                        className="join_btn" 
                        style={{position:'relative', top: '-85px',  fontSize: '14px', fontWeight: '600', color: '#111'}} >
                        {/* Link가 아님, 데이터를 가져오도록  */}
                        <Link to= '/' style={{ color: '#333' }}>검색</Link>
                    </Button>  
                </Grid>
                <Grid xs={4} md={4} item >
                    {/* Fllower component */}
                    <Button 
                    style={{position:'relative', top: '-85px',  fontSize: '14px', fontWeight: '600', color: '#111'}} >
                        팔로워
                    </Button>    
                </Grid>
                <Grid xs={4} md={4} item >
                    {/* Fllowing component */}
                    <Button 
                    style={{position:'relative', top: '-85px',  fontSize: '14px', fontWeight: '600', color: '#111'}} >
                        팔로잉
                    </Button>    
                </Grid>
            </Grid>
        </Box>
    );
}
